import React, { useState, useEffect } from 'react';
import confetti from 'canvas-confetti';
import ApologySection from './components/ApologySection';
import QuizSection from './components/QuizSection';
import RomanticCard from './components/RomanticCard';

const App = () => {
  const [phase, setPhase] = useState('loading');
  const [progress, setProgress] = useState(0);
  const [noCount, setNoCount] = useState(0);
  const [noStyle, setNoStyle] = useState({});
  const [yesScale, setYesScale] = useState(1);

  useEffect(() => {
    if (phase === 'loading') {
      const interval = setInterval(() => {
        setProgress((prev) => {
          if (prev >= 99) {
            clearInterval(interval);
            setTimeout(() => {
              setPhase('apology');
            }, 800);
            return 99;
          }
          return prev + 2;
        });
      }, 30);
      return () => clearInterval(interval);
    }
  }, [phase]);

  const moveNoButton = () => {
    const x = Math.random() * (window.innerWidth * 0.7);
    const y = Math.random() * (window.innerHeight * 0.7);
    setNoStyle({
      position: 'fixed',
      left: `${x}px`,
      top: `${y}px`,
      transition: '0.15s cubic-bezier(0.18, 0.89, 0.32, 1.28)',
      zIndex: 999
    });
    setNoCount(noCount + 1);
    setYesScale(prev => prev + 0.2);
  };

  const triggerKisses = () => {
    const end = Date.now() + (6 * 1000);

    const frame = () => {
      confetti({
        particleCount: 7,
        angle: 60,
        spread: 55,
        origin: { x: 0, y: 0.8 },
        colors: ['#ff4d6d', '#ff0000', '#ff85a1'],
        shapes: ['circle']
      });
      confetti({
        particleCount: 7,
        angle: 120,
        spread: 55,
        origin: { x: 1, y: 0.8 },
        colors: ['#ff4d6d', '#ff0000', '#ff85a1'],
        shapes: ['circle']
      });

      if (Date.now() < end) requestAnimationFrame(frame);
    };
    frame();
  };

  const handleApologyComplete = () => {
    setPhase('quiz');
  };

  const handleQuizComplete = () => {
    setPhase('romanticCard');
  };

  const handleRomanticCardComplete = () => {
    setPhase('success');
    triggerKisses();
  };

  return (
    <div className="min-h-screen w-screen flex justify-center items-center bg-[#fff0f3] font-['Comic_Sans_MS','Chalkboard_SE',sans-serif] m-0 overflow-hidden relative">
      {/* MAIN CONTENT */}
      {phase === 'loading' && (
        <div className="p-10 rounded-[30px] bg-white shadow-xl shadow-[#ff4d6d]/30 max-w-md w-[90%] z-10 border-4 border-[#ffb3c1]">
          <h2 className="text-[#ff4d6d] text-2xl">Booting "Super Boyfriend" Mode...</h2>
          <div className="w-full h-[15px] bg-[#ffe5ec] rounded-full my-5">
            <div className="h-full bg-[#ff4d6d] rounded-full transition-all duration-100 ease-linear" style={{ width: `${progress}%` }} />
          </div>
          <p>{progress}%</p>
        </div>
      )}

      {phase === 'apology' && (
        <ApologySection onNext={handleApologyComplete} />
      )}

      {phase === 'quiz' && (
        <QuizSection onNext={handleQuizComplete} />
      )}

      {phase === 'romanticCard' && (
        <RomanticCard onNext={handleRomanticCardComplete} />
      )}

      {phase === 'success' && (
        <div className="p-10 rounded-[30px] bg-white shadow-xl shadow-[#ff4d6d]/30 max-w-md w-[90%] z-10 border-4 border-[#ffb3c1]">
          <h1 className="text-5xl">üíã</h1>
          <h2 className="text-[#ff4d6d] text-2xl">SUCCESS!</h2>
          <p className="text-[#666] text-lg">The contract is signed! You are my Valentine forever. ‚ù§Ô∏è</p>
          <div className="bg-[#fff0f3] p-4 rounded-xl mt-5 text-left">
            <p className="font-bold">Kisses Owed: 1,000,000+</p>
            <p className="font-bold">Lemon Farming Help: Mandatory</p>
          </div>
        </div>
      )}

      {/* BOTTOM TICKER */}
      <div className="fixed bottom-0 w-full bg-[#ffb3c1] text-[#ff4d6d] py-2 font-bold text-sm whitespace-nowrap">
        I LOVE YOU MORE THAN LEMONS ‚Ä¢ PLEASE SAY YES ‚Ä¢ SORRY I'M LATE ‚Ä¢ YOU ARE BEAUTIFUL ‚Ä¢
      </div>
    </div>
  );
};

export default App;
